import React, { Suspense, lazy } from "react";
import ReactDom from "react-dom/client";
import "./index.css";
import HeaderComponent from "./HeaderComponent";
import Body from "./Body";
//import RestorentCard from "./src/RestorentCard";
import { createBrowserRouter, RouterProvider, Outlet } from "react-router-dom";
import Contact from "./Contact";
import Error from "./Error";
import Restorentmenu from "./Restorentmenu";
import { Provider } from "react-redux";
import appStore from "./utils/appStore";

/*
 code splitting
 dynamic bundaling
 splitting
 dynamic importing
 on demand call

*/
const Grosery = lazy(() => import("./Grosery"))

const About = lazy(() => import("./About"))

const SwigyApp = () => {
    return (
        <Provider store={appStore}>
        <div className="appLayout">
            <HeaderComponent />
            <Outlet />
        </div>
        </Provider>
    )
}

const amarRouter = createBrowserRouter([
    {
        path: "/",
        element: <SwigyApp />,
        children: [
            {
                path: "/",
                element: <Body />,
            },
            {
                path: "./about",
                element: <Suspense><About /></Suspense>,
            },
            {
                path: "./contact",
                element: <Contact />,
            },
            {
                path: "./cart",
                element: <Cart />,
            },
            {
                path: "./grosery",
                element: <Suspense><Grosery /></Suspense>,
            },
            {
                path: "/restorents/:resId",
                element: <Restorentmenu />
            }

        ],
        errorElement: <Error />,
    },

]);
// const root = ReactDom.createRoot(document.getElementById("root"));
//root.render(<SwigyApp/>);

// root.render(<RouterProvider router={amarRouter} />)
//root.render(amar);


export default function App() {
    return (
        <RouterProvider router={amarRouter} />
    )
}
